import styled from "styled-components";

function Header() {
    return (
        <Container>
            <h1>Topo</h1>
        </Container>
    )
}

const Container = styled.div`
    background-color: var(--cor-fundo-topo);
    width: 375px;
    font-family: 'Playball', cursive;

        h1 {
            color: #FFFFFF;
        }
`

export default Header;
